using namespace std;

template <typename RandomIt>
void MakeJosephusPermutation(RandomIt first, RandomIt last, uint32_t step_size) {
    list <typename RandomIt::value_type> pool;
    
    for (auto memb = first; memb != last; memb++) {
        pool.push_back(move(*memb));
    }
    size_t cur_pos = 0;
    auto pool_copy_it = pool.begin();
    
    while (!pool.empty()) {
        //*(first++) = move(pool[cur_pos]);
        advance(pool_copy_it, cur_pos);
        *(first++) = move(*pool_copy_it);
        
        pool.erase(pool_copy_it);
        if (pool.empty()) {
            break;
        }
        cur_pos = (cur_pos + step_size - 1) % pool.size();
        pool_copy_it = pool.begin();
    }
}

vector<int> MakeTestVector() {
    vector<int> numbers(10);
    iota(begin(numbers), end(numbers), 0);
    return numbers;
}

void TestIntVector() {
    const vector<int> numbers = MakeTestVector();
    {
        vector<int> numbers_copy = numbers;
        MakeJosephusPermutation(begin(numbers_copy), end(numbers_copy), 1);
        assert(numbers_copy == numbers);
    }
    {
        vector<int> numbers_copy = numbers;
        MakeJosephusPermutation(begin(numbers_copy), end(numbers_copy), 3);
        assert(numbers_copy == vector<int>({0, 3, 6, 9, 4, 8, 5, 2, 7, 1}));
    }
}

//   ,    ,   
//  MakeJosephusPermutation    .
//  , ,     ,   
//      

struct NoncopyableInt {
    int value;

    NoncopyableInt(const NoncopyableInt&) = delete;
    NoncopyableInt& operator=(const NoncopyableInt&) = delete;

    NoncopyableInt(NoncopyableInt&&) = default;
    NoncopyableInt& operator=(NoncopyableInt&&) = default;
};

bool operator==(const NoncopyableInt& lhs, const NoncopyableInt& rhs) {
    return lhs.value == rhs.value;
}

ostream& operator<<(ostream& os, const NoncopyableInt& v) {
    return os << v.value;
}

void TestAvoidsCopying() {
    vector<NoncopyableInt> numbers;
    numbers.push_back({1});
    numbers.push_back({2});
    numbers.push_back({3});
    numbers.push_back({4});
    numbers.push_back({5});

    MakeJosephusPermutation(begin(numbers), end(numbers), 2);

    vector<NoncopyableInt> expected;
    expected.push_back({1});
    expected.push_back({3});
    expected.push_back({5});
    expected.push_back({4});
    expected.push_back({2});

    assert(numbers == expected);
}

int main() {
    TestIntVector();
    TestAvoidsCopying();
}

function getArrayLength() {
    let length;
    do {
        length = parseInt(prompt("  "));
    } while (isNaN(length) || length < 1);
    return length;
}
 
function fillArray(array, length) {
    for (let i = 0; i < length; i++) {
        array[i] = prompt(" " + (i + 1) + "/" + length + "  ");
    }
}
 
function printArray(array) {
    let asString = "[";
    for (let i = 0; i < array.length; i++) {
        asString += array[i] + (i < (array.length - 1) ? ", " : "");
    }
    asString += "]"
    console.log(asString);
}
 
function reverseArray(array) {
    for (let i = 0, j = array.length - 1, middle = array.length / 2, buffer; i < middle; i++, j--) {
        buffer = array[i];
        array[i] = array[j];
        array[j] = buffer;
    }
}
 
function main() {
    let arrayLength = getArrayLength();
    let array = [];
    fillArray(array, arrayLength);
    printArray(array);
    reverseArray(array);
    console.log("  :");
    printArray(array);
}
 
