using namespace std;

class CashBox {
private:
    bool reversed = false;
    deque<int> data;

public:
    void push(int num) {
        if (reversed) {
            data.push_front(num);
        } else {
            data.push_back(num);
        }
    }

    size_t size() {
        return data.size();
    }

    int del() {
        int res;
        if (reversed) {
            res = data.back();
            data.pop_back();
        } else {
            res = data.front();
            data.pop_front();
        }
        return res;
    }
    
    void reverse() {
        reversed = !reversed;
    }

    void swap(CashBox &other) {
        std::swap(data, other.data);
        std::swap(reversed, other.reversed);
    }

    void move_to(CashBox &other) {
        other.push(del());
    }
};

class Shop {
private:
    CashBox first;
    CashBox second;
    bool reversed = false;
    bool allOpened = true;
    vector<int> served;

    void get_true(int &place) {
        if (reversed) {
            place = (place + 1) % 2;
        }
    }

    void reverse() {
        reversed = !reversed;
    }

public:
    void push(int num, int place) {
        if (!allOpened) {
            second.push(num);
            return;
        }
        get_true(place);
        if (place == 0) {
            first.push(num);
        } else {
            second.push(num);
        }
    }

    void del(int place) {
        if (!allOpened) {
            if (first.size() > 0) {
                served.push_back(first.del() % 10);
            } else {
                served.push_back(second.del() % 10);
            }
            return;
        }
        get_true(place);
        if (place == 0) {
            served.push_back(first.del() % 10);
        } else {
            served.push_back(second.del() % 10);
        }
    }

    void close(int place) {
        get_true(place);
        allOpened = false;
        if (place == 0) {
            first.reverse();
            first.swap(second);
            reverse();
        } else {
            second.reverse();
        }
    }

    void open() {
        size_t commonSize = first.size() + second.size();
        int half = (commonSize + 1) / 2;
        while (first.size() < half) {
            second.move_to(first);
        }
        while (first.size() > half) {
            first.reverse();
            second.reverse();
            first.move_to(second);
            first.reverse();
            second.reverse();
        }
        second.reverse();
        allOpened = true;
    }

    void print() {
        for (auto elem : served) {
            cout << elem;
        }
        cout << '\n';
    }
};

int main() {
    Shop shop;
    int n;
    cin >> n;
    char ty;
    int cur = 1;
    for (int i = 1; i <= n; i++) {
        cin >> ty;
        if (ty == 'a') {
            shop.push(cur++, 0);
        }
        if (ty == 'b') {
            shop.push(cur++, 1);
        }
        if (ty == 'A') {
            shop.del(0);
        }
        if (ty == 'B') {
            shop.del(1);
        }
        if (ty == '>') {
            shop.close(0);
        }
        if (ty == ']') {
            shop.close(1);
        }
        if (ty == '<' || ty == '[') {
            shop.open();
        }
    }
    shop.print();
}

#include <algorithm>
#include <iostream>
#include <string>
#include <vector>

using namespace std;

class MinQueue {
private:
    static const int MIN_FOR_EMPTY = 1e9 + 1;
    vector<int> data;
    size_t dataBegin;
    vector<int> minData;
    size_t minDataBegin;

public:
    void push(int val) {
        data.push_back(val);
        while (minData.size() > minDataBegin && minData.back() > val) {
            minData.pop_back();
        }
        minData.push_back(val);
    }

    int min() {
        if (minDataBegin == minData.size()) {
            return MIN_FOR_EMPTY;
        } else {
            return minData[minDataBegin];
        }
    }

    void pop() {
        if (minData[minDataBegin] == data[dataBegin++]) {
            ++minDataBegin;
        }
    }

    void clear() {
        dataBegin = minDataBegin = 0;
        data.clear();
        minData.clear();
    }
};

class MaxQueue {
private:
    static const int MAX_FOR_EMPTY = -(1e9 + 1);
    vector<int> data;
    size_t dataBegin;
    vector<int> maxData;
    size_t maxDataBegin;

public:
    void push(int val) {
        data.push_back(val);
        while (maxData.size() > maxDataBegin && maxData.back() < val) {
            maxData.pop_back();
        }
        maxData.push_back(val);
    }

    int max() {
        if (maxDataBegin == maxData.size()) {
            return MAX_FOR_EMPTY;
        } else {
            return maxData[maxDataBegin];
        }
    }

    void pop() {
        if (maxData[maxDataBegin] == data[dataBegin++]) {
            ++maxDataBegin;
        }
    }

    void clear() {
        dataBegin = maxDataBegin = 0;
        data.clear();
        maxData.clear();
    }
};

int main() {
    MinQueue minq;
    MaxQueue maxq;
    int n;
    cin >> n;
    vector<int> a(n);
    for (auto &x : a) {
        cin >> x;
    }
    int m;
    cin >> m;
    int del;
    while (m--) {
        minq.clear();
        maxq.clear();
        cin >> del;
        int ans = 0;
        int left = 0, right = 0;
        int r = 0;
        for (int l = 0; l < n; ++l) {
            r = max(l, r);
            while (r < n && max(maxq.max(), a[r]) - min(minq.min(), a[r]) <= del) {
                minq.push(a[r]);
                maxq.push(a[r]);
                ++r;
            }
            if (ans < r - l) {
                ans = r - l;
                left = l;
                right = r - 1;
            }
            if (r > l) {
                minq.pop();
                maxq.pop();
            }
        }
        cout << left + 1 << ' ' << right + 1 << '\n';
    }
}

