            if (q.size() > 0) {
                update_answer();
            }
        }
        if (q.size() <= p) {
            q.emplace(time, i);
            if (q.size() == 1) {
                update_answer();
            }
        } else {
            ans[i] = time;
        }
    }
    while (q.size() > 0) {
        q.pop();
        if (q.size() > 0) {
            update_answer();
        }
    }

    for (int i = 0; i < n; ++i) {
        cout << ans[i] / 60 << " " << ans[i] % 60 << "\n";
